import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const data = [];

  // Iterirajte kroz sve dostupne nizove pored niza "time"
  Object.keys(props.variables.hourly).forEach((key) => {
    if (key !== "time") {
      // Kreirajte podatke za trenutni niz
      const dataPoint = props.variables.hourly.time.map((time, index) => ({
        x: time,
        y: props.variables.hourly[key][index],
      }));

      // Dodajte podatke u niz
      data.push({
        name: key, // Ime trenutnog niza
        data: dataPoint, // Podaci za trenutni niz
      });
    }
  });

  // Generirajte linije za svaki niz
  const lines = Object.keys(props.variables.hourly).filter(
    (key) => key !== "time"
  ).map((key) => (
    <Line
      key={key}
      type="monotone"
      dataKey={key}
      name={key}
      stroke="#8884d8"
    />
  ));
  console.log(data);
  
  return (
    <div
      style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}
    >
      <LineChart width={1000} height={500} data={data.data}>
        <XAxis dataKey="time" />
        <YAxis />
        <CartesianGrid stroke="#ccc" />
        {lines}
        <Tooltip />
        <Legend />
      </LineChart>
    </div>
  );
};

export default VariablesGraph;
